import React, { useState } from 'react';
import './styles/Login.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faInstagram, faPinterest, faLinkedin } from '@fortawesome/free-brands-svg-icons';
import { faFingerprint } from '@fortawesome/free-solid-svg-icons';

const Login = () => {
  const [isLogin, setIsLogin] = useState(true);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  const handleLogin = (e) => {
    e.preventDefault();
    if (email && password) {
      window.location.href = '/home';  // Dummy redirection to homepage
    } else {
      alert('Please enter valid credentials.');
    }
  };

  const handleRegister = (e) => {
    e.preventDefault();
    if (email && password === confirmPassword) {
      alert('Registered successfully!');
      setIsLogin(true);  // Switch back to login page after registration
    } else {
      alert('Please check your details. Passwords do not match.');
    }
  };

  return (
    <div className="login-container">
      <form className="login-form" onSubmit={isLogin ? handleLogin : handleRegister}>
        <h2>{isLogin ? 'Login' : 'Register'}</h2>
        <p>
          {isLogin 
            ? 'By signing in you are agreeing to our '
            : 'By registering you are agreeing to our '}
          <span>Term and privacy policy</span>
        </p>

        <div className="tabs">
          <a 
            href="#" 
            className={isLogin ? 'active' : ''} 
            onClick={() => setIsLogin(true)}
          >
            Login
          </a>
          <a 
            href="#" 
            className={!isLogin ? 'active' : ''} 
            onClick={() => setIsLogin(false)}
          >
            Register
          </a>
        </div>

        <div className="input-group">
          <label>Email Address</label>
          <input 
            type="email" 
            placeholder="Email Address" 
            value={email} 
            onChange={(e) => setEmail(e.target.value)} 
          />
        </div>

        <div className="input-group">
          <label>Password</label>
          <input 
            type="password" 
            placeholder="Password" 
            value={password} 
            onChange={(e) => setPassword(e.target.value)} 
          />
        </div>

        {!isLogin && (
          <div className="input-group">
            <label>Confirm Password</label>
            <input 
              type="password" 
              placeholder="Confirm Password" 
              value={confirmPassword} 
              onChange={(e) => setConfirmPassword(e.target.value)} 
            />
          </div>
        )}

        {isLogin && (
          <div className="password-options">
            <label>
              <input type="checkbox" /> Remember password
            </label>
            <a href="#" className="forgot-password">Forgot password</a>
          </div>
        )}

        <button type="submit" className="login-btn">
          {isLogin ? 'Login' : 'Register'}
        </button>

        {isLogin && (
          <>
            <p>or connect with</p>
            <div className="social-login">
              <a href="#"><FontAwesomeIcon icon={faFacebook} /></a>
              <a href="#"><FontAwesomeIcon icon={faInstagram} /></a>
              <a href="#"><FontAwesomeIcon icon={faPinterest} /></a>
              <a href="#"><FontAwesomeIcon icon={faLinkedin} /></a>
            </div>

            {/* Fingerprint icon here */}
            <div className="fingerprint">
              <FontAwesomeIcon icon={faFingerprint} size="3x" />
            </div>
          </>
        )}
      </form>
    </div>
  );
};

export default Login;
